var Utility = {};
Utility.array_search = function (a, c, b) {
    for (var d in a) {
        if (a[d][b] == c) {
            return a[d]
        }
    }
    return null
};
Utility.array_remove = function (a, d, c) {
    for (var b = 0; b < a.length; b++) {
        if (d == a[b][c]) {
            return a.splice(b, 1)[0]
        }
    }
    return null
};
Utility.array_sort = function (a, b) {
    function c() {
        return function (f, d) {
            var g = f[b];
            var e = d[b];
            return e - g
        }
    }

    a.sort(c())
};
Utility.get_array_by_value = function (b, f, e) {
    var c = [];
    for (var d = 0; d < b.length; d++) {
        if (f == b[d][e]) {
            c.push(b[d])
        }
    }
    return c
};
Utility.get_random_array = function (b, f) {
    var a = b.length;
    if (a <= f) {
        return b
    }
    var d = [];
    for (var e = 0; e < a; e++) {
        d[e] = e
    }
    d.sort(function () {
        return 0.5 - Math.random()
    });
    var c = [];
    for (e = 0; e < f; e++) {
        c.push(b[d[e]])
    }
    return c
};
Utility.delegate = function (b, a) {
    return function () {
        return a.apply(b, arguments)
    }
};
Utility.getRandom = function (d, a) {
    var b = a - d;
    var c = Math.random() * b + d;
    return parseInt(c, 10)
};
Utility.startCountdown = function (c, e, d, a) {
    var b = setInterval(function () {
        c -= e;
        if (c <= 0) {
            clearInterval(b);
            if (a) {
                a(0)
            }
        } else {
            if (d) {
                d(c)
            }
        }
    }, e * 1000)
};
Utility.getUrlParams = function () {
    var j = {};
    var f = window.location.href;
    var b = f.indexOf("?");
    if (b > 0) {
        var h = f.substring(b + 1);
        var e = h.split("&");
        for (var g = 0, c, d; c = e[g]; g++) {
            d = e[g] = c.split("=");
            j[d[0]] = d.length > 1 ? d[1] : true
        }
    }
    return j
};
var log = function (a) {
    console.log(a)
};